import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

const Ourbenefits = () => {
  return (
      <Container>
        <h3>OUR BENEFITS</h3>
        <em>Luxury AutoStar Rental Services</em>
      <Row>
        <Col>
        <img src='https://autostar.templines.org/wp-content/uploads/2018/12/as001.jpg' />
        <h5>Our Customers Always<br/>100% Satisfied</h5>
        <em>Lorem ipsum dolor sit amet consectetur adipisicing elit sed don eiusmod tempor enim minim veniam<br/>quis notrud exercitation</em>
        </Col>
        <Col>2 of 3</Col>
        <Col>3 of 3</Col>
      </Row>
    </Container>
  )
}

export default Ourbenefits
